import styled from 'styled-components';

type Props ={
    customstyle: string 
}

export const DeafaultSection = styled.div<Props>`
    height: 90vh;
    max-height: 90vh;
    ${props => (props.customstyle !== '' ? props.customstyle : '')}
`;
export const Header = styled.h1`  
    text-align: center;
    margin: 0;
    padding: %;
    height: 10%;
`;
